INSERT INTO locations VALUES (29,'Coyote Hills Regional Park','http://www.ebparks.org/parks/coyote.htm','Fremont',12,'Note to photographers: Slow and cautious walk on the marsh bordwalk can yield good shots of egrets and ducks. On some days, a great place for pelican flight shots. White-tailed kites seen almost every trip, often far away. Early morning access restricted by locked gate approx 1/2 mile from parking lot -- no good parking outside the gate. Entrance fee. Bathrooms available.',37.5505981445,-122.0859985352,0);
