INSERT INTO locations VALUES (33,'Don Edwards Center','http://www.r1.fws.gov/sfbnwr/default.htm','Alviso',2,'Note to photographers: The Don Edwards Center and surrounding area afford many bird photography opportunities. Begin by driving the access road slowly, looking for shorebirds foraging in the marsh next to the road. Sparrows, towhees, thrushes, and some warblers near the parking lot can be fairly cooperative. Walk out on the levee for flight shots of gulls and terns. No entrance fee, Porta potty available. The gate is  often locked in the morning, you can walk in after parking your car off the road.',37.4327011108,-121.9619979858,0);
