INSERT INTO locations VALUES (56,'McClellan Ranch','http://www.scvas.org/office.html','Cupertino',2,'the home of the Santa Clara Valley Audubon Society.\r\n\r\nNote to photographers: This site in a deep canyon affords little direct light in the morning, but does offer an interesting variety of passerines visiting the feeders at the Audubon society office or the community garden plots. Choose your angles carefully to deliberately include or exclude manmade perches and backgrounds.',37.3138999939,-122.0619964600,0);
