INSERT INTO locations VALUES (63,'Mount Hamilton','','San Jose',2,'Note to photographers: The road over Mount Hamilton is an inevitable part of our tour through Mines Road. For more details, see Birding at the Bottom of the Bay. Bring your long lens and keep an eye out for Lewis\'s Woodpecker, and other passerines (i. e., Lark Sparrow). Also be sure to stop at Grant Ranch Park and work the trees for thrushes, bluebirds, and other passerines. ',37.3418998718,-121.6419982910,0);
