INSERT INTO locations VALUES (68,'Palo Alto Duck Pond','http://www.xymox.palo-alto.ca.us/av/baylands.html','Palo Alto',2,'our second most visited site; location of bill\'s first birdwalk with Steve Shunk.\r\n\r\nNote to photographers: This site is now most famous for the egret and night-heron rookery located immediately adjacent to the duck pond parking lot. Here in April and May you can get great morning light shots of nesting egrets and night-herons  squabbling over nest sites, sitting on eggs, perched in the palm trees with their chicks, or flying frequently to and from the nest. Be sure to check the duck pond for interesting and highly acclimated ducks and gulls -- with a 500mm you can get some great portraits here. Be sure to check the trees around the pond for passerines and raptors.',37.4573287964,-122.1088256836,0);
