INSERT INTO locations VALUES (85,'Rancho San Antonio','http://www.openspace.org/RANCHO.html','Cupertino',2,'Note to photographers: Rancho San Antonio is a very popular park for jogging and bicycling. So, don\'t go there expected a quiet, contemplative communion between you and your subject. You will find good morning light and some acclimated and cooperative woodpeckers and various passerines. At midday it is possible to find shaded subjects against shaded backgrounds if you work at it. No entrance fee. Parking can be difficult on the weekends. Bathrooms provided. The park is officially open from 8am until shortly after sunset, but in practice the gate is often opened earlier in the morning.',37.3311004639,-122.0920028687,0);
