INSERT INTO locations VALUES (167,'Shoreline Lake','','Mountain View',2,'Note to photographers: The lake can be a good early morning spot for Goldeneye, Bufflehead, Canvasback, Grebes, Gulls, and Coots. It\'s tempting to chase your target birds up and down the shore, but I find its more productive to be quiet and stationary and let the birds drift toward you as they forage. Check the trees for Red-tailed Hawks. This can also be a good spot for sparrows and some shorebirds. There is a booth at the entrance to the park, but I have never paid a fee there. Bathrooms available. Parking can be crowded on the weekends.',37.4332542419,-122.0921478271,0);
